/** @format */

import React from "react";
const Navbar = () => {
  return (
    <>
      <div className="container Navbar">
        <div className="row ">
          <div className="col-md-6 logoo">
            <h1>
              Usman<span style={{ color: "green" }}>Khalid</span>{" "}
            </h1>
          </div>
          <div className="col-md-6 Navlinks  ">
            <ul className="d-flex justify-content-end ">
              <li>
                <a href="facebook.com">Home</a>
              </li>
              <li>
                <a href="facebook.com">Services</a>
              </li>
              <li>
                <a href="facebook.com">About</a>
              </li>
              <li>
                <a href="facebook.com">Contact</a>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
};
const Footer = () => {
  return (
    <h1 className="text-center">
      Â© 2020 ThapaTechnical. All Rights Reserved | Terms and Conditions
    </h1>
  );
};
const Comman = () => {
  return (
    <>
      <Navbar />
      <Footer />
    </>
  );
};
export default Comman;
